import React from 'react'
import {Navbar,Container} from 'react-bootstrap'
const Header = () => {
  return (
    <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#home">React-bbo</Navbar.Brand>
    </Navbar>
  )
}

export default Header
